VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 20, 'deficiency and excess of pathogenic factors in MGH, namely the type of blood deficiency and stasis. Blood deficiency refers to insufficient blood storage, and results in a decrease in the nutritional and nourishing function of blood, which lead to dysfunction of organs and tissues due to loss of nourishment. The dysfunction of the liver in storing blood and regulating blood volume leads to abnormal blood flow, blood leaves the meridians and remains outside the veins, which causes blood stasis. Blood stasis does not go, new blood is not produced, so the cycle is repeated, which is the type of blood deficiency and blood stasis obstruction in breast hyperplasia. Patients usually have breast lumps, pain like acupuncture, pale face, dry and rough skin, withered hair, brittle claws dim vision, numbness of hands and feet, poor flexion and extension of limbs, palpitations, insomnia, dreaminess, forgetfulness.', '{0.017189791426062584,0.31755530834198,0.8340629935264587,-0.6334823369979858,0.33289486169815063,0.8009352684020996,0.5892311930656433,0.03983109071850777,-0.4179207980632782,-0.5234280824661255,0.11158790439367294,0.7751777172088623,-1.0155283212661743,-0.14416936039924622,-0.9133524298667908,0.18484938144683838,-0.1328132152557373,-0.5348402857780457,0.11747174710035324,-0.5735425353050232,0.2822556793689728,-0.3958970308303833,0.40301916003227234,0.4888862669467926,0.38883644342422485,-0.08688118308782578,-0.6012924313545227,-0.21194835007190704,-0.5004436373710632,-0.7355448007583618,-0.2891802191734314,-0.08186429738998413,-0.3443332016468048,0.6734038591384888,-0.07412460446357727,0.6124736070632935,-0.28886330127716064,0.6750680804252625,-0.5690249800682068,0.27527904510498047,-0.39436259865760803,-1.098180890083313,0.0008710867259651423,-0.6660545468330383,-0.21854019165039062,-0.9262847900390625,0.0049238973297178745,0.1453855186700821,-0.03995636850595474,0.6650296449661255,0.1427407