VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 25, 'hormones, improve liver and systemic blood circulation, and promote hormone metabolism in the body. Herbs for resolving phlegm, softening hardness, and dispersing nodules can promote the absorption of pathological products and inflammatory exudates, promote the dissipation of fibrous tissue and other substances around the glands, thus inhibiting breast gland hyperplasia. The iodine components in herbs for reducing swelling and dissipating nodules can stimulate the production of P in the anterior pituitary gland, reduce estrogen levels in the body, thus can be used to treat breast hyperplasia.', '{0.08360671997070312,0.35096630454063416,0.8951333165168762,-0.18556205928325653,-0.11227406561374664,0.6085245609283447,-0.10025084018707275,0.2863066494464874,-0.3291154205799103,0.0013024210929870605,0.110863596200943,-0.2487504780292511,-0.4931573271751404,-0.08557486534118652,-0.033460453152656555,-0.095883809030056,0.29025065898895264,-0.40091246366500854,0.4269847869873047,-0.45771533250808716,0.27368322014808655,-0.2942565679550171,-0.09273319691419601,-0.30169087648391724,-0.16465464234352112,-0.6691532135009766,-0.12820032238960266,-0.1322866529226303,-0.29652029275894165,0.014705190435051918,-0.05242638289928436,0.7580438852310181,0.27278563380241394,0.2852329909801483,0.5524274110794067,0.28024494647979736,0.21735557913780212,0.7845466136932373,-0.05327429994940758,-0.1378466784954071,0.2822970151901245,-0.46717745065689087,-0.2763965427875519,-0.7829096913337708,-0.18413430452346802,-0.8984520435333252,0.49158141016960144,-0.3500320315361023,0.46503764390945435,0.45242244005203247,0.33562958240509033,0.11487020552158356,-0.566107988357544,0.046353451907634735,0.08747630566358566,-0.002227559220045805,-0.08750680088996887,0.2367047369480133,0.6424623727798462,0.4714277386665344,-0.21221257746219635,0.09656972438097,0.5986276268959045,-1.0800745487213135,-0.7210437059402466,0.1708943992853164