VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Integrating antiretroviral therapy into HIV care dramatically extended the lifespan for people living with HIV. Improving the health span requires understanding aging, HIV, associated comorbid conditions, and concurrent treatments. The 14th annual International Workshop on HIV and Aging on October 26–27, 2023 included podium presentations on: Sarcopenia: Biology, Pathophysiology, Prevention and Treatment; Long-acting ART; Central Nervous System (CNS) complications; Asymptomatic Neurocognitive Impairment (ANI); Mental Health; Loneliness; and Resilience. Presentations highlighted persistent concerns for people living with HIV including sarcopenia and frailty, mental health, loneliness, and cognition. Presenters encouraged prioritizing mental health treatment, reducing social isolation, and research on resiliency.', '{-0.11066257208585739,-0.506476104259491,0.717300534248352,-0.408831924200058,0.1813645213842392,1.2665165662765503,-0.22005312144756317,0.9330195784568787,0.17114078998565674,-0.9012276530265808,-0.08397464454174042,-0.20967140793800354,0.30891793966293335,-0.23887427151203156,-0.7068878412246704,0.20301489531993866,-0.2406332790851593,-0.03100450336933136,0.3550657033920288,0.21299958229064941,-0.26134970784187317,0.530469536781311,-0.9267672896385193,-0.042577292770147324,-0.6894737482070923,0.037929076701402664,-0.205159530043602,-0.29913821816444397,0.5170377492904663,0.1492607593536377,-0.9317777156829834,-0.06266129016876221,-1.0848733186721802,0.6505759358406067,-0.2397245168685913,0.20850799977779388,-0.08867725729942322,-0.13313394784927368,-0.7693399786949158,0.2504965364933014,0.02188071236014366,0.00428859842941165,-0.23666447401046753,0.6490492820739746,-0.013661914505064487,0.7336689829826355,0.30915892124176025,-0.08876620978116989,0.01941974274814129,-0.10437946021556854,-0.11875813454389572,-0.12143874913454056,0.3319648802280426,-0.30982330441474915,0.955067634582519