VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Height outcome in patients with classic congenital adrenal hyperplasia (CAH) is suboptimal due to glucocorticoid and androgen excess. In an open, randomized, controlled trial, children with classic CAH were randomized to receive a combination regimen of antiandrogen, aromatase inhibitor, reduced hydrocortisone, and fludrocortisone prior to puberty or standard therapy (hydrocortisone, fludrocortisone). Females continued on antiandrogen during puberty. The primary endpoint was adult height. Of 62 children randomized, 45 completed the study. Adult height SDS did not differ between the investigational and control groups (−0.34 [0.93] vs −0.60 [0.89], respectively), mean difference 0.26 [95% CI −0.29, 0.82],  Prepubertal antiandrogen, aromatase inhibitor combination with reduced hydrocortisone improves short-term predicted height for children with CAH but does not result in taller adult stature than those treated with standard therapy, and is not recommended.', '{0.21504293382167816,0.2659238278865814,0.11370936036109924,-0.5206806063652039,-0.8027943968772888,0.2531455159187317,0.28752636909484863,0.0766870379447937,0.49854207038879395,-0.16180723905563354,0.005667385645210743,0.6805679798126221,-0.355629563331604,-0.5940243601799011,-0.23725561797618866,0.2268848568201065,1.0960041284561157,0.23603257536888123,0.1638055294752121,0.08452111482620239,0.07049644738435745,-0.6118941307067871,-0.09066805988550186,-0.004879200831055641,-0.8098697066307068,-0.31449267268180847,-0.7114177942276001,-0.11497358977794647,0.24296683073043823,-0.9988847970962524,-0.45845991373062134,-0.5196275115013123,0.6082565188407898,-0.5142350196838379,-0.24098879098892212,0.27033761143684387,0.24241358041763306,1.1134259700775146,-0.07202809303998947,-0.452735036611557,0.344488263130188,0.23508292436599731,-0.27981024980545044,-0.36809301376342773,-0.18969139456748962,0.2576899230480194,-0.5384169220924377,0.1745468974113