VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'Calcitonin gene-related peptide (CGRP)–targeted therapies, including monoclonal antibodies (mAbs) and gepants, represent a major advancement in migraine prevention, offering greater efficacy and improved tolerability compared with traditional treatments. These agents selectively inhibit the CGRP pathway, a key mediator in migraine pathophysiology, and are increasingly used even as first-line options in selected patients. While clinical trials and real-world data suggest a favorable cardiovascular (CV) safety profile, particularly in patients without major risk factors, evidence remains limited for those with established vascular disease or recent vascular events. Concerns persist regarding long-term effects and the safety of CGRP blockade in high-risk populations. This narrative review focuses on the CV and cerebrovascular safety of CGRP-targeted migraine treatments—an area of growing clinical relevance.', '{0.2812741994857788,0.06353046000003815,-0.09050380438566208,-0.5049671530723572,0.13402165472507477,0.055870044976472855,0.347969651222229,-0.4568411111831665,0.24727410078048706,-1.0370452404022217,-0.47047126293182373,0.21461890637874603,0.34029823541641235,-0.2659826874732971,-0.2844233512878418,-0.019602304324507713,0.197357177734375,-0.04492170363664627,-0.22933468222618103,-0.03142315894365311,-0.682349443435669,0.16375190019607544,0.14955256879329681,0.22356800734996796,0.15231551229953766,-0.08667419850826263,-0.22635029256343842,-0.18902036547660828,-0.017316555604338646,-0.5623118877410889,-0.3500109314918518,-0.019427569583058357,0.3000078797340393,-0.21574313938617706,-0.5425208806991577,0.25690317153930664,-0.05162520334124565,2.2266337871551514,-0.595187246799469,-0.198312446475029,0.7932134866714478,1.1245768070220947,-0.2335509955883026,-0.06749673932790756,0.29517310857772827,0.07517543435096741,-0.3651203215122223,1.000754714012146,-0.06404024362564087,0.019734514877200127,