VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 2, 'nical practice. Migraine is the second most prevalent debilitating disorder among young individuals. Stroke is the second leading cause of death worldwide and the leading cause of long-term disability. Approximately two-thirds of all strokes are ischemic, and one-third is hemorrhagic. Shared Risk Factors of Stroke and Migraine Abbreviations: CRP = C-reactive protein; CSD = cortical spreading depression; IL = interleukin; PFO = patent foramen ovale. A comprehensive search was conducted on MEDLINE using the terms “stroke,” “CGRP,” “gepants,” and “monoclonal antibodies,” combined with the linking word “AND.” Abstracts were then screened for relevance to the topic, and full-text articles were reviewed to extract relevant information and for relevant references. All recommendations in the discussion are the consensus of the authors, based on current evidence. Currently, 2 types of CGRP pathway–targeting medications are available: monoclonal antibodies (mAbs) and gepants.', '{0.1905958354473114,0.21306385099887848,0.5048679709434509,-0.6013356447219849,-0.012817218899726868,0.13113650679588318,0.34574443101882935,-0.016618037596344948,-0.4279901385307312,-1.0382612943649292,-0.6020867824554443,0.15624400973320007,0.12044758349657059,-0.004758116789162159,-0.2610546052455902,-0.10899855196475983,0.38865241408348083,-0.2637055516242981,-0.11907617747783661,0.24108152091503143,-0.7381832003593445,-0.32544514536857605,-0.14825521409511566,-0.07020486891269684,0.21358174085617065,0.13458770513534546,0.03339916840195656,-0.5198288559913635,-0.12127561122179031,0.15106865763664246,-0.4773833155632019,-0.30984973907470703,-0.21334771811962128,0.0025453492999076843,-0.5545845627784729,-0.1783384382724762,0.1294885277748108,1.4140232801437378,-0.6892884969711304,0.08937312662601471,0.2608465552330017,0.8418564200401306,-0.6275894045829773,0.20741261541843414,0.019802335649728775,-0.07619956135749817,-0.06476923