VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 3, 'types of CGRP pathway–targeting medications are available: monoclonal antibodies (mAbs) and gepants. For episodic and chronic migraine treatment, 4 mAbs are approved: eptinezumab, erenumab, fremanezumab, and galcanezumab. The migraine preventive effect of erenumab is caused by the mAb''s binding affinity to the extracellular canonical CGRP receptor, whereas eptinezumab, fremanezumab, and galcanezumab bind to the endogenous CGRP ligand, respectively. Given their half-life of approximately 28–32 days, the administration of erenumab, fremanezumab, and galcanezumab requires a monthly subcutaneous application. By contrast, eptinezumab is administered IV at 3-month intervals, and for high-dose fremanezumab, every 3-month subcutaneous application is possible. The orally or nasally administered gepants directly interact with the CGRP receptor by binding one of the subunits of the canonical CGRP receptor.', '{0.4399428963661194,0.4104793667793274,0.18358178436756134,-0.47033414244651794,0.24983511865139008,0.07342176139354706,-0.036933235824108124,0.30525875091552734,-0.3421217203140259,-0.8335000872612,-0.2700377106666565,0.5320567488670349,0.6979519128799438,-0.31185218691825867,-0.3589663803577423,-0.1529722511768341,0.02966548688709736,0.017446039244532585,-0.11139338463544846,0.10934778302907944,-0.49365511536598206,-0.17760832607746124,0.09601198136806488,0.07450128346681595,0.6051895618438721,0.05025148764252663,0.04825001209974289,-0.38326072692871094,-0.2759978771209717,-0.07095321267843246,-0.25902891159057617,-0.03851465880870819,0.13903377950191498,0.06011411175131798,-0.41819652915000916,0.1727699190378189,-0.044899821281433105,1.64333176612854,-0.47864973545074463,-0.21263517439365387,0.5486846566200256,1.2715667486190796,-0.03837915137410164,-0.37479621171951294,0.05123431608080864,-0.3879132866859436,-0.004305592738091946,0.7374592423439026,0.3671623468399048,-0.43974706530570984,0.359939