VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 5, 'ts, mAbs cannot penetrate the BBB to a relevant amount, which is due to their high molecular weight. In summary, CGRP-targeting migraine therapies have been demonstrated to exhibit a significantly reduced side-effect profile and higher efficacy in reducing MHDs in comparison with conventional migraine preventatives. This assertion is substantiated by the findings of the randomized, double-blind HERMES trial, which conducted a comparative analysis between erenumab and topiramate. They also have a much favorable benefit-risk ratio, especially in the largest migraine patient group: young women of childbearing age. The use of mAbs and gepants targeting the CGRP system has proven to be an effective, safe, and well-tolerated approach for reducing migraine attacks. Recent studies have extended follow-up periods beyond 2 years and included patients with CV risk factors.', '{0.3887104392051697,0.6865015625953674,-0.07969916611909866,-0.416502445936203,-0.3099746108055115,-0.06519316136837006,-0.01351155061274767,-0.17140507698059082,-0.10946006327867508,-0.8509969115257263,-0.30526331067085266,0.41923531889915466,0.5494281649589539,-0.32477429509162903,-0.4917996823787689,0.29827067255973816,0.10617494583129883,0.16104213893413544,-0.15770792961120605,-0.18804095685482025,-0.9982566833496094,-0.1713670790195465,0.15807174146175385,-0.03613448143005371,0.2981734275817871,-0.0484633594751358,-0.1464070826768875,-0.2681490182876587,-0.21145136654376984,0.04062411189079285,-0.44705456495285034,-0.09458626061677933,0.006310109049081802,0.09658180922269821,-0.25338152050971985,-0.20051239430904388,-0.08258852362632751,1.7513303756713867,0.3633081614971161,-0.12393546104431152,0.44324371218681335,1.289159893989563,-0.08703192323446274,-0.40486931800842285,0.05730651691555977,-0.35917627811431885,-0.3807098865509033,0.6505478024482727,0.4895572364330292,-0.09566980600357056,0.2214818000793457,-0.4636695683002472