VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 6, 't studies have extended follow-up periods beyond 2 years and included patients with CV risk factors. For example, an analysis of AEs associated with erenumab showed low incidences of ischemic CV and cerebrovascular events, with similar rates across different 10-year CV risk categories. A recent study In a double-blind, placebo-controlled study, 88 participants with stable angina received either an IV infusion of erenumab (140 mg) or placebo, followed by an exercise treadmill test. An observational cohort study assessed the CV safety of erenumab and fremanezumab over at least 1 year. In Europe, the EudraVigilance database confirmed that CV adverse drug reactions linked to anti-CGRP therapies align with existing literature. Because gepants represent the latest approved targeted migraine therapies, study data beyond comprehensive approval studies are scarce.', '{-0.07880355417728424,0.601632297039032,-0.2810527980327606,-0.11144440621137619,-0.22658833861351013,0.5551406741142273,0.1513168215751648,-0.46823644638061523,-0.19766511023044586,-1.3622649908065796,-0.6932084560394287,0.47273388504981995,0.37275081872940063,-0.938841700553894,0.1751788705587387,0.10305797308683395,0.18318411707878113,0.5251743793487549,-0.00290188891813159,0.06098300963640213,-0.838840901851654,0.17078760266304016,-0.07283514738082886,-0.007355773355811834,-0.19911988079547882,-0.5295685529708862,-0.13112372159957886,0.4166620373725891,0.3954888880252838,-0.6900222897529602,-0.14605310559272766,-0.2182612419128418,0.04543080925941467,-0.1190149188041687,0.08067595213651657,-0.11912641674280167,-0.6044840216636658,1.4536882638931274,-0.8862117528915405,-0.6636638641357422,0.45236891508102417,1.4443416595458984,-0.07482607662677765,-0.33234846591949463,-0.11552409082651138,-0.027714448049664497,-0.5684548020362854,0.7716955542564392,0.26958706974983215,-0.22701981663703918,-0.18529099225997925,-0.4963509738445282,-0.568636