VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 8, 'dilation; mAb = monoclonal antibody; RCT = randomized controlled trial; VMR = vasomotor reactivity. A case report describes a 41-year-old woman with episodic migraine without aura who received preventive mAb therapy with erenumab 70 mg. Two case reports have described reversible cerebral vasoconstriction syndrome (RCVS) in women who were undergoing preventive therapy with fremanezumab The results of the large RCTs, which enrolled more than 10,000 patients with migraine, did not indicate any relevant increase in CV risk in patients who received mAbs or gepants. This is a significant finding, given that RCTs represent the highest level of evidence in medicine. In addition, the combination of CGRP-targeting therapies with potentially vasoconstrictive triptans or nonsteroidal anti-inflammatory drugs (NSAIDs) is safe in RCTs and in real-world data.', '{0.6068558692932129,0.6749654412269592,0.04820956662297249,-0.4014366567134857,0.2393788844347,0.27762940526008606,0.301867812871933,-0.4477510154247284,0.2536485195159912,-1.3178471326828003,-0.10523037612438202,0.5169797539710999,0.6211184859275818,-0.6302046179771423,-0.1524447202682495,0.20086240768432617,0.05360948294401169,0.26909568905830383,0.2183428704738617,-0.3324435353279114,-1.0940731763839722,0.16647197306156158,0.17994515597820282,0.2963433265686035,-0.27453139424324036,-0.15120166540145874,-0.08489086478948593,-0.24339079856872559,-0.09958966821432114,-0.1136569157242775,-0.2487410604953766,-0.2687847912311554,-0.2534668743610382,0.036172255873680115,0.035380780696868896,0.22729405760765076,-0.22361451387405396,1.4478685855865479,-0.4004644751548767,-0.2309579849243164,-0.08869052678346634,0.6195256114006042,-0.13973695039749146,-0.008130952715873718,-0.011814959347248077,0.03860154375433922,-0.4685819745063782,0.45277559757232666,-0.013456419110298157,-0.1255880445241928,0.08992403000593185,-0.2434556931257248,-0.4062204658985138,-0.196