VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 13, 'ory drug; RCT = randomized controlled trial; RP = Raynaud phenomenon; SAH = subarachnoid hemorrhage. It would be beneficial for future investigations to comprise animal and human data on a multidisciplinary level to gain a deeper understanding of the safe use of CGRP-targeting therapies. It is also important to recognize the vital role that neurologists play in diagnosing and treating migraine patients effectively over time. Although evidence about a dual blockade of the CGRP pathway with mAbs for preventive treatment and gepants for acute migraine treatment is scarce, increasing numbers of people with migraine have been using this kind of therapy. Because dual CGRP blockade represents the latest possibility in migraine prevention and acute treatment, only a handful of studies exist evaluating the efficacy and safety of this combination.', '{0.592755913734436,0.40827199816703796,0.1866511106491089,-0.4086824655532837,-0.01488465629518032,-0.27823305130004883,-0.2184952050447464,-0.12302744388580322,0.2497299164533615,-0.7874883413314819,-0.25180408358573914,0.2469431608915329,0.44299113750457764,-0.004917552229017019,-0.7371798157691956,-0.0703430101275444,0.14190112054347992,0.06382620334625244,-0.14722940325737,-0.31437358260154724,-0.9543210864067078,-0.1285843402147293,-0.030557502061128616,0.3539493680000305,0.45691320300102234,-0.005195797421038151,-0.30827444791793823,-0.2571389675140381,-0.25974833965301514,0.24665619432926178,-0.3183239698410034,0.10605883598327637,-0.21071520447731018,-0.4717717468738556,-0.19456720352172852,-0.15833012759685516,-0.24707463383674622,1.954558253288269,0.10250917822122574,0.028634382411837578,0.5989113450050354,1.0423974990844727,-0.3996300995349884,-0.5002179145812988,0.16501416265964508,-0.251308798789978,-0.1743730902671814,0.6336683630943298,0.02431650646030903,0.014264694415032864,0.27779534459114075,-0.48005518317222595,-0.5571975708007812,-0.2148