VALUES (currval(pg_get_serial_sequence('medical_documents', 'id')), 0, 'The jugular venous pulse (JVP) reflects right atrial pressure and provides diagnostic insight into cardiovascular and pulmonary health. However, reliable assessment remains difficult due to neck adiposity, anatomical variability and suboptimal positioning. Although central venous catheterization is the gold standard, its invasive nature restricts routine or long-term use. This study introduces a non-invasive method for JVP estimation using a 60 GHz frequency-modulated continuous wave (FMCW) radar. The system captures venous pulsations at the skin surface and applies eigenbeamforming to enhance signal-to-noise ratio and pulse clarity. Radar parameters were optimized for signal fidelity and validated through morphological comparison with simultaneously recorded photoplethysmography (PPG) signals. Additionally, we compared radar-derived JVP signals with previously recorded catheterization data from a patient with early-stage heart failure to assess clinical relevance.', '{-0.09596090763807297,-0.28814053535461426,-0.8448689579963684,-0.27425768971443176,0.1122073158621788,0.1058717593550682,-0.5265843272209167,-0.21012206375598907,0.11791805922985077,-0.38024744391441345,-0.30488118529319763,0.12703192234039307,-0.10452476143836975,-0.21735651791095734,0.19104965031147003,-0.36737653613090515,-0.05867234244942665,0.25782880187034607,0.3937002122402191,-0.21887141466140747,-0.02385265938937664,-0.6555445790290833,-0.2596491277217865,0.5344022512435913,1.6855210065841675,-0.0698809027671814,0.6171433329582214,0.07590140402317047,-0.3276047110557556,-0.13988201320171356,0.21637240052223206,0.19496822357177734,-0.9955794811248779,-0.22541381418704987,-0.26110681891441345,-0.3012724220752716,0.332479327917099,0.5891823172569275,-0.11255646497011185,0.1698557287454605,-0.6827535629272461,-0.43186840415000916,0.3396013081073761,-0.3596939444541931,0.01569143496453762,-0.25247976183891296,-0.02732634171843